import React from 'react';
import './index.css';

const alphabet = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'.split('');

function App() {
  return (
    <div>
      <h1>Alphabet with Yei</h1>
      <div className="alphabet-container">
        {alphabet.map((letter) => (
          <div key={letter} className="letter-box">
            {letter}
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;pp;
